import {MObject, MObjectHandler} from "./MObject";
import {parseSchema} from "./schemaInterpreter";

/**
 * The BasicHandler implements a trap for the get method. It checks whether the
 * property is a function, and if it is it inserts the klass name of the object
 * into the arguments for the function. We do this because any function invoked
 * on the data manager is a constructor function that must know which klass it is constructing
 */
let BasicHandler = {
	/**
	 * @param {Object} target - The target object.
	 * @param {String, Symbol} propKey - The name of the property to get.
	 * @param {Object} receiver - Either the proxy or an object that inherits from the proxy.
	 *
	 * @return {*} Either the value of the requested property or a function that executes the requested 
	 * property after inserting the property key as its first argument
	 */
	get(target, propKey, receiver){
		/* if an attribute was accessed, simply return the value */
		var propValue = target[propKey];
		if (typeof propValue != "function"){
			return propValue;
		}
		else{
			/* return a function that inserts the property key into the arguements and then executes the 
			 * method call on the target */
			return function(){
				//arguments.unshift(propKey);
				[].unshift.call(arguments, propKey);
				return propValue.apply(target, arguments, propKey);
			}
		}
	}
}

/**
 * mix is an anonymous function that returns a new MixinBuilder for the superclass
 *
 * @param {Class} superclass - an ES6 class definition that should be extended with mixins
 * @return {MixinBuilder} An instance of MixinBuilder for the given superclass
 */
let mix = (superclass) => new MixinBuilder(superclass);

/**
 * MixinBuilder is a class that dynamically constructs a prototype chain for the superclass
 * given to its constructor.
 */
class MixinBuilder {  

	/**
	 * @param {Class} superclass - an ES6 class definition that should be extended with mixins
	 */
	constructor(superclass) {
		/**
		 * @type {Class}
		 */
		this.superclass = superclass;
	}

	/**
	 * with takes an arbitrary number of mixins as argument. A mixin is defined as follows:
	 *
	 * (superclass) => class extends superclass {}
	 *
	 * This definition results in an anonymous class that extends the given superclass. This way
	 * we can reduce an array of mixins starting with this mixinBuilder's  superclass.
	 *
	 * @param {Function} mixin1,mixin...,mixinN - an arbitrary number of mixins that the superclass should be extended with
	 *
	 * @return {Class} this mixinBuilders superclass extended with all given mixins
	 */
	with(...mixins) {
		return mixins.reduce((c, mixin) => mixin(c), this.superclass);
	}
}

/**
 * The factory function constructs a new instance of an MObject with the appropriate
 * mixins applied to it.
 *
 * @param {String} klass - A string representing the klass of the managed object.
 * @param {Object} inits - An object containing initial values for the managed object
 * @param {*} [otherArg1,otherArg...,otherArgN] - Any other parameters passed to the factory are 
 * considered other arguments. These other arguments are passed to the constructor of the managed object 
 * and are meant to be used by mixins. Each mixin can then extract its required extra parameters from the otherArgs
 *
 * @return {MObject} A proxied managed object that matches the schema and implements all mixin functionality
 */ 
let factory = function(klass, inits, ...otherArgs) {
	let schema = this.schema.klassSchemas[klass].schema;
	let subKlasses = this.schema.klassSchemas[klass].subKlasses;

	let mobjClass = {};
	if(this.mixins.length > 0) {
        mobjClass = (class extends mix(MObject).with(...this.mixins){});
    } else {
        mobjClass = (class extends MObject {});
    }

	let mobj = new mobjClass(schema, klass, subKlasses, ...otherArgs);
	let mObjProxy = new Proxy(mobj, new MObjectHandler());

	/* The MObject needs a pointer to its own proxy for when an inverse field is found */
	mObjProxy.setThisProxy(mObjProxy);
	mObjProxy.init(inits);

	return mObjProxy;
}

/**
 * The DataManager consists of a constructor that receives a schema and optionally a number of mixins as input.
 *
 * The schema is parsed and for each klass a factory function is assigned to this[klassName]
 *
 * Finally a proxy is wrapped around this instance of the basicRecord factory that
 * ensures factory.klassName(inits, args) call is forwarded to the factory function as
 * factory(klassName, inits, args)
 */
export class DataManager {
	/**
	 * @param {Object} schema - A raw JSON schema describing the objects that should be constructed by this data manager
	 * @param {Function} [mixin1,mixin...,mixinN] - an arbitrary number of mixins that should be used to extend managed
	 * objects constructed by the basic data manager
	 */
	constructor(schema, ...mixins) {
        /**
         * An array of mixins for the managed objects created by this data manager
         * @type {Array}
         */
        this.mixins = []

        /* set mixins for the factory function. If the basic data manager did not receive
         * any mixins we set it to an empty array */
        if(mixins.length > 0 && mixins[0] != undefined) {
            this.mixins = mixins;
        }

		/* create a new schema interpreter and parse the sceham */
		let i = new interpreter.SchemaInterpreter();

		/**
		 * @type {Schema}
		 */
		this.schema = i.parseSchema(schema);

		/* 
		 * @type {Function}
		 */
		this[this.schema.mainKlass] = factory;
		for(var klass in this.schema.klassSchemas) {
			/*
			 * @type {Function} 
			 */
			this[klass] = factory;
		}

		/* wrap the dataManager behind a proxy */
		return new Proxy(this, BasicHandler);
	}
}

import {MFieldFactory} from "./fields/MFieldFactory.js";

/**
 * MObjectHandler provides a get and a set trap for the proxy that is wrapped around a
 * managed object. The set trap simply invokes our custom set() function on the MObject.
 * get first checks whether the requested property in the object is a function. If it is
 * we execute that function. Otherwise, the requested property key is forwarded to our custom
 * get() function in the MObject
 */
export class MObjectHandler {
	/**
	 * @param {Object} target - The target object.
	 * @param {String, Symbol} propKey - The name of the property to get.
	 * @param {Object} receiver - Either the proxy or an object that inherits from the proxy.
	 *
	 * @return {*} Either the value of the requested property or a function that executes the requested property
	 */
	get(target, propKey, receiver) {
		var propValue = target[propKey];
		if (typeof propValue != "function"){		
			/* if the property is not a function: return MObject.__get(propKey) */
			return target.get(propKey);
		}
		else{
			/* return a function that executes the method call on the target */
			return function(){
				return propValue.apply(target, arguments, propKey);
			}
		}

	}

	/**
	 * @param {Object} target - The target object.
	 * @param {String, Symbol} propKey - The name of the property to set.
	 * @param {*} value - The value to set the property to
	 * @param {Object} receiver - Either the proxy or an object that inherits from the proxy.
	 *
	 * @return {Boolean} true if setting the value was succesful. If setting the value failed an 
	 * exception is thrown ny the managed object
	 */
	set(target, propKey, value, receiver) {
		/* invoke MObject.__set(propKey, value) */
		return target.set(propKey, value);
	}
}

/**
 * MObject implements the basic functionality for managed data:
 * 
 * It provides a set() and get() method for managed fields that will be invoked by the proxy
 * wrapped around this object. Managed fields are stored in the 'data' property of an MObject.
 *
 * Furthermore, it provides a notifyArrayChanged() callback that will be invoekd whenever an
 * ArrayMField changes its state.
 */
export class MObject {
	/**
	 * Constructor function for a managed object
	 *
	 * @param {Object} schema - A schema describing the data property of this managed object
	 * @param {String} klass - A string representing the klass name of tihs managed object
	 */
	constructor(schema, klass) {
		/**
		 * @type {Object}
		 */
		this.data = {};
		/**
		 * this.proxy may only contain a pointer to the proxy wrapped around this instance of MObject
		 * @type {Object}
		 */
		this.proxy = {};
		/**
		 * @type {String}
		 */
		this.klass = klass;

		/**
		 * @type {Schema}
		 */
		this.schema = schema;
	}

	/**
	 * Init function that initializes the data property with managed fields and sets an initial
	 * value if this was provided in the inits parameter
	 *
	 * @param {Object} inits - An object containing the initial values for this MObject
	 */
	init(inits) {
		let ownSchema = {
			"type": "object",
			"klass": this.klass
		}

		for(let propKey in this.schema.properties) {
			this.data[propKey] = MFieldFactory(
									this.schema.properties[propKey],
									this.proxy
								);
		}

		for(let propKey in inits) {
			this.__set(propKey, inits[propKey]);
		}
	}

	/**
	 * @param {Object} proxy - The proxy wrapped around this MObject
	 */
	setThisProxy(proxy) {
		if(!proxy === this) {
			throw new TypeError("the given proxy must be this object's proxy!")
		}
		this.proxy = proxy;
	}

	/**
	 * @return {String} A string representing the klass that this MObject implements
	 */
	getKlass() {
		return this.klass;
	}

	/**
	 * @param {String, Symbol} propKey - The property key of the managed field that we want to access
	 */
	get(propKey) {
		if(this.data.hasOwnProperty(propKey)) {
			return this.data[propKey].getValue();
		} else {
			throw new TypeError("property "+propKey+" is not defined in schema");
		}
	}

	/**
	 * @param {String, Symbol} propKey - The property key of the managed field that we want to access
	 * @param {*} value - The value that we want to set the managed field to
	 *
	 * @return {Boolean} True if setting was succesfull
	 */
	set(propKey, value) {
		if(this.data.hasOwnProperty(propKey)) {
			this.data[propKey].setValue(value);
		} else {
			throw new TypeError("property "+propKey+" is not defined in schema");
		}
		return true;
	}

	/**
	 * @param {Symbol, String} propKey - The property key of the field that we want to get the type of
	 *
	 * @return {String} The type of the field stored in data[propKey]
	 */
	__getType(propKey) {
		if(this.data.hasOwnProperty(propKey)) {
			return this.data[propKey].getType()
		} else {
			throw new TypeError("property "+propKey+" is not defined in schema")
		}
	}

	/**
	 * By default the modification methods of managed arrays bypasses
	 * the set trap. Because of this, arrays notify their superKlass when they change.
	 * This way an MObject can still implement its functionality whenever an array field
	 * is modified by extending this function.
	 *
	 * @param {ArrayMField} array - The array that was modified
	 * 
	 * @return {Symbol} - The property key that points to the changed array
	 */
	notifyArrayChanged(array) {
		let propKey = undefined;
		for(let key in this.data) {
			if(this.data[key].getType() == "array" && this.data[key] == array) {
				propKey = key;
			}
		}
		if(propKey == undefined) {
			throw new TypeError("something went wrong");
		}

		return propKey;
	}

	/**
	 * @return {String} A string representing the managed object
	 */
	toString() {
		return "[managedObject "+this.klass+"]"
	}
}

import {IntegerMField, NumberMField, StringMField, BooleanMField, MObjectMField} from "./MFieldSingle"
import {ArrayHandler, ArrayMField, EnumMField, OneOfMField} from "./MFieldMulti"

/**
 * MField is a factory function that returns one of the following managed fields
 * based on the given schema:
 * 		IntegerMField
 *		NumberMField
 *		StringMField
 *		BooleanMField
 *		MObjectMField
 *		ArrayMField
 *		EnumMField
 *		OneOfMField
 *
 * This function abstracts the MField implementation away from the user
 * as all outside functionality is provided by the base MField class
 * Note that there is one exception: The array MField, which has some additionional
 * Behaviour.
 *
 * @param {Object} schema - A (partial) JSON schema that describes the field that should be constructed
 * @param {MObject} superKlass - The MObject that this field belongs to
 *
 * @return {MField} An MField that ensures its value property matches the given schema
 */
export function MFieldFactory(schema, superKlass) {
	if(schema.hasOwnProperty("enum")) {
		return new EnumMField(schema)
	}

	if(schema.hasOwnProperty("oneOf")) {
		console.log("building oneOf field")
		return new OneOfMField(schema, superKlass)
	}

	if(schema.hasOwnProperty("type")) {
		switch(schema.type) {
			case "integer": {
				return new IntegerMField(schema)
				break
			}
			case "number": {
				return new NumberMField(schema)
				break
			}
			case "string": {
				return new StringMField(schema)
				break
			}
			case "boolean": {
				return new BooleanMField(schema)
				break 
			}
			case "object": {
				return new MObjectMField(schema, superKlass)
				break
			}
			case "array": {
				return new Proxy(new ArrayMField(schema, superKlass), new ArrayHandler())
				break
			}
		}
	}
}

