		 * If we have a list of items, this parameter keeps track of which item
		 * we need to use to validate the next element
		 * @type {number}
		 */
		this.itemsIdx = 0

		/**
		 * The length of the array stored in this.value
		 * @type {number}
		 */
		this.length = 0

